import './App.css';
import Header from './Header';
import List from './List';
import LoginForm from './LoginForm';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className='app' style={{ marginTop: '2rem' }}>
      <Header />
      <BrowserRouter>
        <Routes>
          <Route path='/tasks' element={ <List 
            token={ 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJzdWIiOjAsImxvZ2luIjoidXNlcjEyM2EiLCJpYXQiOjE3MTAxNjA1NzZ9.34gsrMlh4oJ-o1SbolIOCMm7FYPDGfFO-XXIja2dFz8' }
          /> } />
          <Route path='/login' element={ <LoginForm /> } />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
